import React from "react";

const useStyles = makeStyles({
  color: "red",
});

function Navbar() {
  return (
    <AppBar>
      <Toolbar>
        <Typography>Praveen Kariyawasam</Typography>
      </Toolbar>
    </AppBar>
  );
}

export default Navbar;
